import React, {Component} from 'react';

import './Welcome.css';
import Play from './play.json';

function Welcome(){
    return(
    <div>
       
        {Play.map((assets ,index) =>{
        return
        <div>
    <p>{assets.filename}</p>
        </div>
    
        
        })
        }
        
        
       
        
        </div>
    )
    
    
}

export default Welcome;
